css:
.editor {
  background-color: #3b3228;
  color: #d0c8c6;
}
.editor .gutter {
  background-color: #3b3228;
  color: #d0c8c6;
}
.editor .gutter .line-number.cursor-line {
  background-color: rgba(126, 112, 90, 0.33);
  color: #d0c8c6;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #d0c8c6;
}
.editor .wrap-guide {
  color: #7e705a;
}
.editor .indent-guide {
  color: #7e705a;
}
.editor .invisible-character {
  color: #7e705a;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: #7e705a;
}
.editor .search-results .marker.current-result .region {
  border: #d0c8c6;
}
.editor.is-focused .cursor {
  border-color: #d0c8c6;
}
.editor.is-focused .selection .region {
  background-color: #645240;
}
.editor.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line {
  background-color: rgba(126, 112, 90, 0.33);
}
.variable.parameter.function {
  color: #d0c8c6;
}
.comment,
.punctuation.definition.comment {
  color: #7e705a;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.string,
.punctuation.definition.parameters,
.punctuation.definition.string,
.punctuation.definition.array {
  color: #d0c8c6;
}
.none {
  color: #d0c8c6;
}
.keyword.operator {
  color: #d0c8c6;
}
.keyword {
  color: #a89bb9;
}
.variable {
  color: #cb6077;
}
.entity.name.function,
.meta.require,
.support.function.any-method {
  color: #8ab3b5;
}
.support.class,
.entity.name.class,
.entity.name.type.class {
  color: #f4bc87;
}
.meta.class {
  color: #f5eeeb;
}
.keyword.other.special-method {
  color: #8ab3b5;
}
.storage {
  color: #a89bb9;
}
.support.function {
  color: #7bbda4;
}
.string,
.constant.other.symbol,
.entity.other.inherited-class {
  color: #beb55b;
}
.constant.numeric {
  color: #d28b71;
}
.none {
  color: #d28b71;
}
.none {
  color: #d28b71;
}
.constant {
  color: #d28b71;
}
.entity.name.tag {
  color: #cb6077;
}
.entity.other.attribute-name {
  color: #d28b71;
}
.entity.other.attribute-name.id,
.punctuation.definition.entity {
  color: #8ab3b5;
}
.meta.selector {
  color: #a89bb9;
}
.none {
  color: #d28b71;
}
.markup.heading .punctuation.definition.heading,
.entity.name.section {
  color: #8ab3b5;
}
.keyword.other.unit {
  color: #d28b71;
}
.markup.bold,
.punctuation.definition.bold {
  font-weight: bold;
  color: #f4bc87;
}
.markup.italic,
.punctuation.definition.italic {
  font-style: italic;
  color: #a89bb9;
}
.markup.raw.inline {
  color: #beb55b;
}
.string.other.link {
  color: #cb6077;
}
.meta.link {
  color: #d28b71;
}
.markup.list {
  color: #cb6077;
}
.markup.quote {
  color: #d28b71;
}
.meta.separator {
  color: #d0c8c6;
  background-color: #645240;
}
.markup.inserted {
  color: #beb55b;
}
.markup.deleted {
  color: #cb6077;
}
.markup.changed {
  color: #a89bb9;
}
.constant.other.color {
  color: #7bbda4;
}
.string.regexp {
  color: #7bbda4;
}
.constant.character.escape {
  color: #7bbda4;
}
.punctuation.section.embedded,
.variable.interpolation {
  color: #bb9584;
}
.invalid.illegal {
  color: #3B3228;
  background-color: #cb6077;
}
